				<img src={logo} alt='' className='header-logo' />
				<div className='icon dashboard'>
					<img src={img1} alt='icon1' />
					<div className='text'>
						<a href='/dashboard'> Dashboard</a>
					</div>
				</div>
				<div className='icon farmer'>
					<img src={img2} alt='icon2' />
					<div className='text'>
						<a href='/farmer'> Farmer</a>
					</div>
				</div>
				<div className='icon vendor'>
					<img src={img3} alt='icon3' />
					<div className='text'>
						<a href='/vendor'> Vendor</a>
					</div>
				</div>
				<div className='icon products'>
					<img src={img4} alt='icon4' />
					<div className='text'>
						<a href='/product'> Products</a>
					</div>
				</div>
				<div className='icon clients'>
					<img src={img5} alt='icon5' />
					<div className='text'>
						<a href='/clients'>Clients</a>{" "}
					</div>
				</div>
			</div>
			
			<div className="right-side">
			<h2 className='main-header'>User Management</h2>
			<button onClick={() => handleClick("addFarmer")}>
				Add Farmer <i class='fa-solid fa-plus'></i>
			</button>
			<table class='table table-striped'>
				{" "}
				<tr className='users'>
					<td className='user'>
						<img
							src='http://health5.ru/wp-content/uploads/2018/03/Rejuvenate-the-face.jpg'
							alt=''
						/>
						<div className='details'>
							<h2>UserName</h2>
							<p>Farmer</p>
						</div>
					</td>
					<td className='user'>
						<img
							src='http://health5.ru/wp-content/uploads/2018/03/Rejuvenate-the-face.jpg'
							alt=''
						/>
						<div className='details'>
							<h2>UserName</h2>
							<p>Farmer</p>
						</div>
					</td>
					<td className='user'>
						<img
							src='http://health5.ru/wp-content/uploads/2018/03/Rejuvenate-the-face.jpg'
							alt=''
						/>
						<div className='details'>
							<h2>UserName</h2>
							<p>Farmer</p>
						</div>
					</td>
				</tr>
				<tr className='users'>
					<td className='user'>
						<img
							src='http://health5.ru/wp-content/uploads/2018/03/Rejuvenate-the-face.jpg'
							alt=''
						/>
						<div className='details'>
							<h2>UserName</h2>
							<p>Farmer</p>
						</div>
					</td>

					<td className='user'>
						<img
							src='http://health5.ru/wp-content/uploads/2018/03/Rejuvenate-the-face.jpg'
							alt=''
						/>
						<div className='details'>
							<h2>UserName</h2>
							<p>Farmer</p>
						</div>
					</td>

					<td className='user'>
						<img
							src='http://health5.ru/wp-content/uploads/2018/03/Rejuvenate-the-face.jpg'
							alt=''
						/>
						<div className='details'>
							<h2>UserName</h2>
							<p>Farmer</p>
						</div>
					</td>
				</tr>
			</table>
			</div>
		</div>
	);
}

